package operatorinjava;

public class RelationalOperatorInJava {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=5;
		int b=5;
		
		boolean c=a < b;
		System.out.println("a < b : "+c);
		
		c=a > b;
		System.out.println("a > b : "+c);
	
		c=a <= b;
		System.out.println("a <= b : "+c);	
		
		c=a >= b;
		System.out.println("a >= b : "+c);
	}

}
